/**
 * Récupération des règlements
 * 
 * @param _parcelles Tableau des identifiants des parcelles dont les règlements demandés (le séparateur est le ;)
 * @param _requeteID (interne OPERIS)
 * @param _to        (interne OPERIS)
 * @param _websocket (interne OPERIS)
 * 
 */
 function SIG_RechercherReglements(_parcelles, _requeteID, _to, _websocket)
 {
	const parcelles=_parcelles.split(';');

	fetch(lizUrls.wms, {
		method: "POST",
		body: new URLSearchParams({
		  repository: lizUrls.params.repository,
		  project: lizUrls.params.project,
		  SERVICE: 'WFS',
		  REQUEST: 'GetFeature',
		  VERSION: '1.0.0',
		  TYPENAME: NOM_COUCHE_REGLEMENT,
		  EXP_FILTER: `"idparc" IN ('${parcelles[0]}')`,
		  OUTPUTFORMAT: 'geojson'
		})
	}).then(function (response) {
		return response.json();
	}).then(response => {

		let XML = '<PARCELLEREGLEMENTS>';

		for (const feature of response.features) {
			XML += '<PARCELLEREGLEMENT>';
			for (const property in feature.properties) {
				if(feature.properties[property]){
					XML += `<${property.toUpperCase()}>${feature.properties[property]}</${property.toUpperCase()}>`;
				}
			}
			XML += '</PARCELLEREGLEMENT>';
		}

		XML += '</PARCELLEREGLEMENTS>';

		// Retour de la réponse au format xml
		const codeErreur = 0;
		const message = 0;
			
		getOperisFlexConnect().OPERIS_RetourRechercherReglements(XML, codeErreur, message, _requeteID, _to, _websocket);
	});
}

/**
 * Impression d'un dossier - Version GeoXalis
 * 
 * @param _dossier   Dossier sérialisé pour lequel est demandé l'image
 * @param _parcelles Liste des identifiants des parcelles (le séparateur est le ;)
 * @param _width     Largeur à appliquer à l'image
 * @param _height    Hauteur à appliquer à l'image
 * @param _context   Contexte d'affichage à appliquer à l'image
 * @param _scale     Echelle à appliquer à l'image
 * @param _zoom      Facteur de zoom à appliquer à l'image
 * @param _requeteID (interne OPERIS)
 * @param _to        (interne OPERIS)
 * @param _websocket (interne OPERIS)
 * 
 */
function SIG_GetImage(_dossier, _parcelles, _width, _height, _context, _scale, _zoom, _requeteID, _to, _websocket)
 {
    var dossier=CreerDossier(_dossier);
    var parcelles=[];
	
	if (_parcelles!="")
		parcelles=_parcelles.split(';');

	if (debug == 1)
		alert("SIG_GetImage(" + dossier.nom + ", " + parcelles.length + " parcelles, largeur=" + _width + ", hauteur=" + _height + ", contexte="  + _context + ", échelle=" + _scale + ", zoom=" + _zoom +")");

	var message = "Dossier :\nCode ADS : " + dossier.codeADS + "\nCode INSEE : "   + dossier.codeINSEE   + "\nAnnée : " 
	                                       + dossier.annee   + "\nInstructeur : "  + dossier.instructeur + "\nNuméro : "
	                                       + dossier.numero  + "\nModificatif : "  + dossier.modificatif + "\nTransfert : "
	                                       + dossier.transfert  + "\nSurface déclarée : "  +  dossier.surfaceDeclaree + "\n\n";	
										   
	message += "Parcelles :\n";
    for (var i = 0; i < parcelles.length; i++)
        message += parcelles[i] + "\n";
		
	if (debug == 1)
		alert(message);
	
	var base64="";

	if (indiceImage==0 || _zoom==0)
	{
		base64="";
		indiceImage=1;
	}
	else if (indiceImage==1)
	{
		base64="";
		indiceImage=2;
	}
	else if (indiceImage==2)
	{
		base64="";
		indiceImage=1;
	}
    
    // Retour du base64
    var codeErreur = 0;
    var message = 0;
    getOperisFlexConnect().OPERIS_RetourGetImage(base64, codeErreur, message, _requeteID, _to, _websocket);
}

